    the Amended August Monthly Report dated 12/04/2012.  The Committee has removed
    the referenced MEMO from the Amended August Monthly Report and moved it to this
    Amended September Monthly Report to correspond to the refund reported on Schedule
    B for Line 28(a).  Please note that the employees that were disclosed on Schedule
    H4 and Schedule B supporting Line 21(b) as payroll spent less than 25% of their
    time during the period working on Federal Election Activity or activities in connection
    with a Federal Election.  This also includes fringe benefits for those specific
    employees.  -   All fundraising and event activity on this report were for the
    sole benefit of the committee and not attributable to any candidate for federal
    office.  -  No transfers from any national committees were used for any activity
    that meets the definition of exempt activity. This report includes Memo Schedule
    A entries for contributions received by the DNC Victory Fund Joint Fundraising
    Program.  The Committee may not have received its share of the proceeds as of
    the end of the reporting period.  If not, the Committee expects to receive transfers
    at some point in time in the near future.\n"
